import React, { useEffect } from "react";
import "./Loader.css";

const Loader = () => {
  useEffect(() => {
    const expandElements = (elementIds, classNames, delay) => {
      elementIds.forEach((id, index) => {
        setTimeout(() => {
          const element = document.getElementById(id);
          if (element) {
            element.classList.add(classNames[index]);
          }
        }, delay[index]);
      });
    };

    const expandP = ["CampusConnect1", "CampusConnect2", "CampusConnect3", "CampusConnect4"];
    const expandI = ["CampusConnect5"];
    const expandX = ["CampusConnect6", "CampusConnect7"];
    const expandE = ["CampusConnect8", "CampusConnect9", "CampusConnect10", "CampusConnect11"];
    const expandL = ["CampusConnect12", "CampusConnect13"];
    const delayP = [2000, 2500, 3000, 3500];
    const delayI = [2000];
    const delayX = [2000, 3000];
    const delayE = [2000, 3500, 3000, 2500];
    const delayL = [2000, 3000];

    expandElements(expandP, ["expandp1", "expandp2", "expandp3", "expandp4"], delayP);
    expandElements(expandI, ["expandi1"], delayI);
    expandElements(expandX, ["expandx1", "expandx2"], delayX);
    expandElements(expandE, ["expande1", "expande2", "expande3", "expande4"], delayE);
    expandElements(expandL, ["expandl1", "expandl2"], delayL);
  }, []);

  return (
    <div className="loader">
      <div className="load">
        <div className="load-whole">
          <div className="p">
            <div id="CampusConnect1" className="p1 a1"></div>
            <div id="CampusConnect2" className="p2 a1"></div>
            <div id="CampusConnect3" className="p3 a1"></div>
            <div id="CampusConnect4" className="p4 a1"></div>
          </div>
          <div className="i">
            <div id="CampusConnect5" className="i1 a1"></div>
          </div>
          <div className="x">
            <div id="CampusConnect6" className="x1 a1"></div>
            <div id="CampusConnect7" className="x2 a1"></div>
          </div>
          <div className="e">
            <div id="CampusConnect8" className="e1 a1"></div>
            <div id="CampusConnect9" className="e2 a1"></div>
            <div id="CampusConnect10" className="e3 a1"></div>
            <div id="CampusConnect11" className="e4 a1"></div>
          </div>
          <div className="l">
            <div id="CampusConnect12" className="l1 a1"></div>
            <div id="CampusConnect13" className="l2 a1"></div>
            <div className="l3 l3-1"></div>
            <div className="l3 l3-2"></div>
            <div className="l3 l3-3"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Loader;
